INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 1, 0, 0, 0, 1, "ミヤコ（クリスマス）", 0, "2025/12/21 12:00:00", 119901, 2.17, 0, 119901, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", "みやこ", 450, 1, 0, 119901, 14, 119901, 302, "2025/12/31 11:59:59", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 5, 0, 0, 0, 5, "シズル（ノワール）", 0, "2025/03/10 12:00:00", 120001, 2.375, 0, 120001, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", "しずる", 450, 1, 0, 120001, 6, 120001, 190, "2025/03/15 14:59:59", 1, 0);
