INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 0, 0, 0, 21, "カスミ（シスター）", 0, "2025/11/03 12:00:00", 137401, 2.09, 0, 137401, "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", "かすみ", 450, 2, 0, 137401, 0, 137401, 688, "2025/11/14 14:59:59", 1, 0);
