INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (3, 7, 0, 0, 0, 0, "コッコロ（嚮導幼君）", 0, "2025/12/31 12:00:00", 137601, 2.09, 0, 137601, "【魔法】後衛で、主さまを想い“進化”した嚮導の巫女。\n極大ダメージのＵＢで敵を穿ち、【進化超越】の権能によ\nって、味方のバフやダメージを、限界を超え成長させる。", "こっころ", 450, 2, 0, 137601, 0, 137601, 733, "2026/01/03 11:59:59", 1, 0);
